import './App.css';

import { BrowserRouter as  Router , Switch , Route} from "react-router-dom";
import Nav from "./Components/Nav";

function App() {
  return (
    <div className="App">
    <Router>

      <Switch>
        <Route path="/" exact>
        <Nav />
        </Route>
        <Route path="/companydetails" exact >
        <Nav />

        </Route>
        <Route path="/emailverification" exact >
        <Nav />

        </Route>
      </Switch>
      </Router>
    </div>

  );
}

export default App;
